export const Container = styled.div`
    position: fixed;
    background-color: rgba(0,0,0, 0.5);

> .ui-modal {
    background-color: #fff;
    border-radius: 4px;
    max-width: 800px;
    margin: 80px auto 0 auto;
    padding: 15px;
  }

> .ui-close-button {
    float: right;
    background: unset;
    border: unset;
  }

`;
